import React from 'react';
import FrontPage from '../pages/frontPage';
import Experts from '../pages/experts'; // Update the path if needed
import { Routes, Route } from 'react-router-dom';
import Contact from '../pages/contact';
import DLogin from '../pages/DLogin'
import Cancer from '../pages/cancer';
import Cardiology from '../pages/cardiology';
import Orthopedic from '../pages/orthopadics';

const AllRoutes = () => {
    return (
        <>
            <Routes>
                <Route path="/" element={<FrontPage />} />
                <Route path="/experts" element={<Experts />} />
                <Route path="/contact" element={<Contact />} />
                <Route path="/doctor" element={<DLogin />} />
                <Route path="/cancer" element={<Cancer/>} />
                <Route path="/cardiology" element={<Cardiology/>} />
                <Route path="/orthopedic" element={<Orthopedic/>} />
                {/* <Route path="/cancer" element={<Cancer/>} />
                <Route path="/cancer" element={<Cancer/>} />
                <Route path="/cancer" element={<Cancer/>} />
                <Route path="/cancer" element={<Cancer/>} /> */}
            </Routes>
        </>
    );
};

export default AllRoutes;
